import React, { useState, useEffect } from 'react'
import { supabase } from './supabaseClient'

function App() {
  const [roomName, setRoomName] = useState('')
  const [userName, setUserName] = useState('')
  const [isInRoom, setIsInRoom] = useState(false)
  const [newRoomName, setNewRoomName] = useState('')
  const [newUserName, setNewUserName] = useState('')
  const [songs, setSongs] = useState([])
  const [newSong, setNewSong] = useState('')
  const [suggestions, setSuggestions] = useState([])

  useEffect(() => {
    if (!isInRoom) return

    loadSongs()

    const channel = supabase
      .channel('public:songs')
      .on(
        'postgres_changes',
        { event: '*', schema: 'public', table: 'songs', filter: `room_id=eq.${roomName}` },
        (payload) => {
          loadSongs()
        }
      )
      .subscribe()

    return () => {
      supabase.removeChannel(channel)
    }
  }, [isInRoom, roomName])

  const loadSongs = async () => {
    const { data, error } = await supabase
      .from('songs')
      .select('*')
      .eq('room_id', roomName)
      .order('votes', { ascending: false })

    if (!error) setSongs(data)
  }

  const fetchSuggestions = async (query) => {
    if (!query) {
      setSuggestions([])
      return
    }

    try {
      const res = await fetch(`http://localhost:3001/search?q=${encodeURIComponent(query)}`)
      const data = await res.json()
      if (Array.isArray(data.tracks)) {
        setSuggestions(data.tracks)
      } else {
        console.error('Invalid suggestions format:', data)
        setSuggestions([])
      }
    } catch (err) {
      console.error('Error fetching suggestions:', err)
      setSuggestions([])
    }
  }

  const handleAddSong = async (title) => {
    const { error } = await supabase.from('songs').insert({
      title,
      room_id: roomName,
      votes: 0,
    })

    if (!error) {
      setNewSong('')
      setSuggestions([])
      loadSongs()
    }
  }

  const handleJoinRoom = () => {
    if (!newRoomName || !newUserName) return
    setRoomName(newRoomName)
    setUserName(newUserName)
    setIsInRoom(true)
  }

  const handleVote = async (songId, delta) => {
    const { data, error: fetchError } = await supabase
      .from('songs')
      .select('votes')
      .eq('id', songId)
      .single()

    if (!fetchError) {
      await supabase
        .from('songs')
        .update({ votes: data.votes + delta })
        .eq('id', songId)

      loadSongs()
    }
  }

  if (!isInRoom) {
    return (
      <div style={{ padding: 40 }}>
        <h1>üé∂ Hang The DJ</h1>
        <input
          type="text"
          placeholder="Room name"
          value={newRoomName}
          onChange={(e) => setNewRoomName(e.target.value)}
        />
        <input
          type="text"
          placeholder="Your name"
          value={newUserName}
          onChange={(e) => setNewUserName(e.target.value)}
        />
        <button onClick={handleJoinRoom}>Join</button>
      </div>
    )
  }

  return (
    <div style={{ padding: 40 }}>
      <h2>Room: "{roomName}"</h2>
      <p>Nickname: {userName}</p>

      <h3>Add song to queue:</h3>
      <input
        type="text"
        value={newSong}
        onChange={(e) => {
          const value = e.target.value
          setNewSong(value)
          fetchSuggestions(value)
        }}
        placeholder="Type a song name"
      />
      <button onClick={() => handleAddSong(newSong)}>Add manually</button>

      {suggestions.length > 0 && (
        <div style={{ marginTop: 10 }}>
          <p>Suggestions:</p>
          <ul>
            {suggestions.map((song) => (
              <li key={song.id}>
                <button onClick={() => handleAddSong(`${song.name} ‚Äî ${song.artists.map(a => a.name).join(', ')}`)}>
                  {song.name} ‚Äî {song.artists.map(a => a.name).join(', ')}
                </button>
              </li>
            ))}
          </ul>
        </div>
      )}

      <h3>üéµ Song queue:</h3>
      <ul>
        {songs.map((song) => (
          <li key={song.id}>
            {song.title} ‚Äî {song.votes} votes
            <button onClick={() => handleVote(song.id, 1)}>üëç</button>
            <button onClick={() => handleVote(song.id, -1)}>üëé</button>
          </li>
        ))}
      </ul>
    </div>
  )
}

export default App
